import React, { useRef, useEffect, useState } from 'react'
import { Form, ToolBar, LocaleUtil, Input } from 'lyrixi-mobile'
// \u516C\u5171\u7EC4\u4EF6\u5BFC\u5165

// \u5185\u90E8\u7EC4\u4EF6\u5BFC\u5165
// \u6837\u5F0F\u56FE\u7247\u7B49\u8D44\u6E90\u6587\u4EF6\u5BFC\u5165

const locale = LocaleUtil.locale

function Filter({ queryParams, onSearch }) {
  const [form] = Form.useForm()
  const modifiedRef = useRef(false)

  const [active, setActive] = useState(false)
  const [visible, setVisible] = useState(false)

  // \u663E\u793A\u5F39\u7A97\u65F6\u9700\u8981\u8FD8\u539F\u503C
  useEffect(() => {
    if (!visible) return
    form.setFieldsValue({
      keyword: queryParams?.keyword || '',
      input: queryParams?.input || ''
    })
    // eslint-disable-next-line
  }, [visible])

  return (
    <ToolBar.Filter
      color={active ? 'primary' : 'default'}
      backgroundColor="default"
      onOpen={() => {
        setVisible(true)
      }}
      onClose={() => {
        setVisible(false)
      }}
      // \u53D6\u6D88\u8FD8\u539F\u6FC0\u6D3B\u72B6\u6001
      onCancel={() => {
        modifiedRef.current = active
      }}
      onConfig={() => {
        console.log('setting')
      }}
      onReset={() => {
        modifiedRef.current = false
        form.resetFields()
      }}
      onOk={({ close }) => {
        setActive(modifiedRef.current)
        console.log(form.getFieldsValue())
        onSearch && onSearch({ ...queryParams, ...form.getFieldsValue() })
        close()
      }}
    >
      <Form
        layout="vertical"
        form={form}
        onValuesChange={() => {
          modifiedRef.current = true
        }}
        style={{ marginLeft: '12px' }}
      >
        <Form.Item name="input" label={locale('\u5355\u884C\u6587\u672C\u6846')}>
          <Input.Text allowClear placeholder={locale('\u8BF7\u8F93\u5165')} maxLength={50} />
        </Form.Item>
      </Form>
    </ToolBar.Filter>
  )
}

export default Filter
