// \u8F6C\u6362 API \u8FD4\u56DE\u6570\u636E\u4E3A\u9875\u9762\u6240\u9700\u683C\u5F0F
function localData(result) {
  // \u6D4B\u8BD5\u6570\u636E
  // eslint-disable-next-line
  result = mockResult
  if (result.code === '1') {
    let list = result?.data?.list
    return {
      status: 'success',
      list: list,
      totalPage: result?.data?.totalPage
    }
  } else {
    return {
      status: 'error',
      message: result.message
    }
  }
}

export default localData
